script: |
  super -f text -I q3160.spq | sort > q3160.out

inputs:
  - name: q3160.spq
    data: |
      SELECT DISTINCT + + ( - ( - - col0 ) ) * - col0 - - col1 - - 56 * + 21 AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q3160.out
    data: |
      3791
      8406
      9504
